import React from "react";
import "./P1.css";
import BTS from "../../../images/BTS-tile.jpg"



function P1Card() {
    return(
        <div className="image-tile">
            <img src={BTS} alt="cat" className="btsImage"></img>
        </div>
    )
}

export default P1Card;
